import './Quote.css';
import Media from 'react-media';

// Return view Qutoe Disable
export default function ReturnQuOte() {
 return (
  <Media
   queries={{
    small: '(max-width: 599px)',
    medium: '(min-width: 600px) and (max-width:1199px)',
    large: '(min-width: 1200px)',
   }}>
   {matches => (
    <>
     {matches.small && <ScreenSmall />}
     {matches.medium && <ScreenLarge />}
     {matches.large && <ScreenLarge />}
    </>
   )}
  </Media>
 );
};


export const ScreenLarge = () => (
 <div className='wrp-quote-dash'>
  <ViewText />
 </div>
);
export const ScreenSmall = () => (
 <div className='wrp-quote-dash-sm'>
  <ViewText />
 </div>
);


export const ViewText = () => (
 <p>
  L'utilisation de E-money vous permet d'offrir le plus haut niveau de transparence
  puisque vous pouvez fournir des informations
 </p>
)
